import React, { Component } from "react";
import "./App.css";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="Header">
          <div className="ShowCase">
            <h1>Museum Locale</h1>
            <p>Get the artworks based on your criteria</p>
          </div>
          <div className="Text">
            <TextField
              className={classes.margin}
              InputLabelProps={{
                classes: {
                  root: classes.cssLabel,
                  focused: classes.cssFocused
                }
              }}
              InputProps={{
                classes: {
                  root: classes.cssOutlinedInput,
                  focused: classes.cssFocused,
                  notchedOutline: classes.notchedOutline
                }
              }}
              label="Custom CSS"
              variant="outlined"
              id="custom-css-outlined-input"
            />
            <TextField
              className="TextField"
              label="Enter Branch"
              variant="outlined"
            />
            <TextField
              className="TextField"
              label="Enter Artist"
              variant="outlined"
            />
            <TextField
              className="TextField"
              label="Enter Decade"
              variant="outlined"
            />
          </div>
          <div className="Button">
            <Button variant="contained" color="secondary">
              Submit
            </Button>
          </div>
          <div className="Arrow">
            <i class="far fa-arrow-alt-circle-down" />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default App;
